== 简介 ==
'''μ's Best Album Best Live! collection II'''是《[[LoveLive!]]》精选集第2弹，发售于2015年5月27日。收录了从《[[我们活在当下(专辑)|{{lang|ja|僕らは今のなかで}}]]》到《[[冬天给予的预感(专辑)|冬がくれた予感‎‎]]》这期间发售的所有曲目，同时也收录了PSV游戏《[[LoveLive!学园偶像天国|LoveLive! School idol paradise]]》上的8首歌曲的remix版本。

在Oricon榜2015年6月8日付周间CD Album排行榜中，“'''μ's Best Album Best Live! collection II'''”获得第一名，同时也是月间排行榜第一名。2015年5月，被日本唱片协会认证为金唱片。

在第30届日本金唱片大赏中，获得了年度最佳动画专辑的奖项。

